import { VISUALIZZA_NOTIFICHE } from "../actions/type";

const INITIAL_STATE = {
  notifica: [],
  notifiche: {},
  error: null,
};

export default (state = INITIAL_STATE, action) => {
  switch (action.type) {
    case VISUALIZZA_NOTIFICHE:
      return {
        ...state,
        notifica: action.payload,
      };
    default:
      return state;
  }
};
